import React, { useState, useEffect } from "react";
import axios from "axios";

const VideoLikes = ({ videoId, apiKey }) => {
    const [likes, setLikes] = useState(null);

    useEffect(() => {
        const getVideoLikes = async () => {
            try {
                const response = await axios.get(
                    `https://www.googleapis.com/youtube/v3/videos?id=${videoId}&part=statistics&key=${apiKey}`
                );
                const { statistics } = response.data.items[0];
                setLikes(statistics.likeCount);
            } catch (error) {
                console.error(error);
            }
        };

        getVideoLikes();
    }, [videoId, apiKey]);

    return (
        <div>
            {likes === null ? (
                <p>Loading likes...</p>
            ) : (
                <p>Likes: {likes}</p>
            )}
        </div>
    );
};

export default VideoLikes;
